import React, { Component } from 'react';
import { isEmpty } from 'react-redux-firebase';
import Join from 'components/Join';
import { Link } from 'react-router-dom';
import PageINPROGRESS from 'pages/PageApp/routes/PageINPROGRESS';
import Header from 'components/Header';

export default class PageList extends Component {
  renderMessage = () => {
    if (this.props.status === 'live-survey') {
      return (
        <div>
          <div>
            Your matches come out on <b>Friday, September 20</b>! Make sure to
            finalize <Link to="/app/survey">your survey!</Link>
          </div>
          <br />
          <PageINPROGRESS />
        </div>
      );
    } else if (this.props.status === 'live-processing') {
      return (
        <div>
          <div>We're calculating matches now! Hang tight!</div>
          <br />
          <PageINPROGRESS />
        </div>
      );
    } else {
      return (
        <div>
          Survey and matches are officially closed! If you have no matches, it
          looks like you didn't fill out the survey fully :(
        </div>
      );
    }
  };

  render() {
    if (
      isEmpty(this.props.matches) ||
      (this.props.status !== 'live-matches' &&
        this.props.status !== 'development' &&
        !this.props.super)
    ) {
      return (
        <div className="PageList">
          <Header>RESULTS</Header>
          <br />
          {this.renderMessage()}
        </div>
      );
    }

    return (
      <div className="PageList">
        <Header>RESULTS</Header>
        <br />
        {Object.keys(this.props.matches).map(match_id => {
          let match = this.props.matches[match_id];
          let user =
            match.user1.id === this.props.uid ? match.user2 : match.user1;

          if (!user.name) {
            return <div />;
          }

          return (
            <div
              key={match_id}
              style={{
                display: 'flex',
                marginBottom: 30,
                maxWidth: 600,
                position: 'relative',
              }}
            >
              {match[this.props.uid] && (
                <div
                  style={{
                    position: 'absolute',
                    top: -10,
                    left: 112,
                    width: 25,
                    height: 25,
                    background: '#EC4E55',
                    borderRadius: '50%',
                  }}
                />
              )}
              <img
                alt="profile"
                src={user.profile_pic || require('assets/empty.png')}
                style={{
                  width: 125,
                  height: 125,
                  objectFit: 'cover',
                  minWidth: 125,
                  background: `url(${require('assets/loading.svg')})`,
                  backgroundSize: 'contain',
                  backgroundRepeat: 'no-repeat',
                  backgroundPosition: 'center',
                }}
              />
              <div className={'info'}>
                <div className={'dorm'}>{user.dorm.toUpperCase()}</div>
                <div className="name">{user.name}</div>
                <div className="description">{user.description}</div>
                {/*<div>{match.rating}</div>*/}
                <button
                  onClick={() =>
                    this.props.history.push('/app/results/' + match_id)
                  }
                >
                  schedule hangout
                </button>
              </div>
              <br />
              <br />
            </div>
          );
        })}

        <Join />
      </div>
    );
  }
}
